import React from "react";
import h from "./header.module.css"


const Header = (props) => {

    const logout = () => {
        return props.logoutBtn()
    }
        return (
        <div className={h.header}>
            Шапка {props.login}
            <button onClick={logout()}>Logout</button>
        </div>
    )
}

export default Header
